import React from "react";
import CartItem from "./CartItem";

class CartExample extends React.Component {
  render() {
    return (
      <React.Fragment>
        <h1>Cart Example in React JS</h1>
        <div>
          <CartItem />
          <CartItem />
          <CartItem />
        </div>
      </React.Fragment>
    );
  }
}

export default CartExample;
